import React, { useState } from 'react';
import './Workerpage.css';

const WorkerPage = () => {
  const [searchQuery, setSearchQuery] = useState('');

  const [employees, setEmployees] = useState([
    { id: 1, name: 'John Doe', dob: '1990-01-01', role: 'Developer' },
    { id: 2, name: 'Jane Smith', dob: '1985-05-15', role: 'Designer' },
    { id: 3, name: 'billgates', dob: '1923-05-15', role: 'tester' },
    { id: 4, name: 'Jhonny', dob: '1923-05-15', role: 'Drawer' },
    // Add more employee data as needed
  ]);

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const filteredEmployees = employees.filter(employee =>
    employee.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className="worker-page-container">
      <img src="logo2.png" alt="Logo" className="logo" />
      <input 
        type="text" 
        placeholder="Search with name" 
        value={searchQuery} 
        onChange={handleSearchChange} 
      />
      <div className="employee-list">
        {filteredEmployees.map(employee => (
          <div key={employee.id} className="employee-item">
            <p className="">Emp ID: {employee.id}</p>
            <p>Name: {employee.name}</p>
            <p>DOB:<span className="dob-data">{employee.dob}</span> </p> {/* Add class for DOB data */}
            <p>Role:<span className="role-data">{employee.role}</span> </p> {/* Add class for Role data */}
          </div>
        ))}
      </div>
      <img src="logo3.png" alt="Worker Logo" className="worker-logo" />
    </div>
  );
}

export default WorkerPage;
